import { motion } from 'framer-motion'
import { Link } from 'react-scroll'

const NavLinks = (props) => {
    // const animationFrom = { opacity: 0, y: -40 }
    // const animateTo = { opacity: 1, y: 0 }

    return (
        <ul className="menu">
            <li className='nav-li'><Link href="home" className="nav-link">Home</Link></li>
            <li className='nav-li'>
                <Link

                    to="about"

                    smooth={true}
                    offset={-100}
                    duration={500}
                    className="nav-link">About</Link></li>

        </ul>
    );
}

export default NavLinks;
